import React from 'react';
import './tests-style.css';
import CardsContainer from './CardsContainer/CardsContainer.js';
import SettingsContainer from './SettingsContainer/SettingsContainer.js';

const Tests = ({ onRouteChange }) => {
	return (
		<div className="centered" id="mainWrap">
		  <div className="half">
		  <div id="preview">
		      <CardsContainer />
		    </div>
		    <div id="lang-title">
		    	<div id="preview-Title"><span>Language</span> Category</div>
		    </div>
		    
		  </div>
		  <div className="half blue">
		    <div id="settingsWrapper">
		        <SettingsContainer />
		    </div>
		  </div>
		</div>
	);
}

export default Tests;
